import { Button, FormControlLabel, TextField } from '@mui/material';
import Box from '@mui/material/Box';
import Checkbox from '@mui/material/Checkbox';
import React from 'react';


const Form = () => {
    function RedBar() {
        return (
          <Box
            sx={{
              height: 20,
              backgroundColor: 'transparent'
            }}
          />
        );
    }

  return (
    <div className="form">
    <div className="form__details">
        <h2>Create an account</h2>
      <form>
        <RedBar/>
        <TextField fullWidth label='Your email Address' placeholder="Enter your Email Address" />
        <RedBar/>
        <TextField fullWidth label='Your password' type="password" id="standard-password-input" placeholder="Enter your Password" />
        <RedBar/>
        <TextField fullWidth label='Confirm your Password' type="password" id="standard-password-input" placeholder="Enter your Confirm Password" />
        <RedBar/>
        <TextField fullWidth label='Your full name' placeholder="Enter your Name" />
        <RedBar/>
        <label for="email">Your email Address</label>
        <input type="text" id="email" name="email"/>
        <label for="lname">Last Name</label>
        <input type="text" id="lname" name="lname"/>
        <TextField label='Your phone number' placeholder="Enter your Phone Number" inputProps={{ inputMode: 'numeric', pattern: '[0-9]*' }}/>
        <RedBar/>
        <FormControlLabel
          value="end"
          control={<Checkbox />}
          label="I have read and agree Terms and Conditions"
          labelPlacement="I have read and agree Terms and Conditions"
          size="small"
        />
        <RedBar/>
        <Button type='submit' variant='contained' color='primary'>Create Account</Button>
      </form>
    </div>
    </div>
  )
}

export default Form;
